import streamlit as st
import pickle
import os
import pandas as pd

# Get the directory of the current script
script_path = os.path.abspath(__file__)

# Set the working directory to the script's directory
os.chdir(os.path.dirname(script_path))

# Specify the path to the model folder relative to the script's directory
model_folder = "model"

# Construct the full path to the model file
model_file_path = os.path.join(model_folder, 'IPL.pkl')

# Load the model
try:
    with open(model_file_path, 'rb') as model_file:
        loaded_model = pickle.load(model_file)
except FileNotFoundError:
    st.error("Model file not found. Make sure the model file exists in the 'model' folder.")
    st.stop()
except Exception as e:
    st.error(f"An error occurred while loading the model: {e}")
    st.stop()

# Streamlit app title and image
st.title("IPL Winning Team Prediction")
st.image("https://media.licdn.com/dms/image/D4D12AQERbnjY_eKM-w/article-cover_image-shrink_720_1280/0/1682084080739?e=2147483647&v=beta&t=6L0vtkEZOr_OhZF_hdObLtHRBHm6PQ83wEgA1aMzZV8")

# Streamlit widgets for user input
team1 = st.selectbox("Pick Team 1", [
    'Rajasthan Royals',
    'Royal Challengers Bangalore',
    'Sunrisers Hyderabad',
    'Delhi Capitals',
    'Chennai Super Kings',
    'Gujarat Titans',
    'Lucknow Super Giants',
    'Kolkata Knight Riders',
    'Punjab Kings',
    'Mumbai Indians'
])
team2 = st.selectbox("Pick Team 2", [
    'Rajasthan Royals',
    'Royal Challengers Bangalore',
    'Sunrisers Hyderabad',
    'Delhi Capitals',
    'Chennai Super Kings',
    'Gujarat Titans',
    'Lucknow Super Giants',
    'Kolkata Knight Riders',
    'Punjab Kings',
    'Mumbai Indians'
])
city = st.selectbox("City", [
    'Ahmedabad', 'Kolkata', 'Mumbai', 'Navi Mumbai', 'Pune', 'Dubai',
    'Sharjah', 'Abu Dhabi', 'Delhi', 'Chennai', 'Hyderabad',
    'Visakhapatnam', 'Chandigarh', 'Bengaluru', 'Jaipur', 'Indore',
    'Bangalore', 'Kanpur', 'Rajkot', 'Raipur', 'Ranchi', 'Cuttack',
    'Dharamsala', 'Nagpur', 'Johannesburg', 'Centurion', 'Durban',
    'Bloemfontein', 'Port Elizabeth', 'Kimberley', 'East London',
    'Cape Town'
])
runs_left = st.number_input("Runs Left")
balls_left = st.number_input("Balls Left")
wickets_left = st.slider("Wickets Left",0,10)
current_run_rate = st.number_input("Current Run Rate")
required_run_rate = st.number_input("Required Run Rate")
target = st.number_input("Target")

# Prediction logic
if st.button("Predict"):
    try:
        # Prepare input data as DataFrame
        input_data = {
            'BattingTeam': [team1],
            'BowlingTeam': [team2],
            'City': [city],
            'runs_left': [runs_left],
            'balls_left': [balls_left],
            'wickets_left': [wickets_left],
            'current_run_rate': [current_run_rate],
            'required_run_rate': [required_run_rate],
            'target': [target]
        }
        input_df = pd.DataFrame(input_data)

        # Make prediction
        prediction = loaded_model.predict(input_df)

        # Display prediction
        if prediction[0] == 1:
            st.header(team2)
            if team2=='Sunrisers Hyderabad':
                st.image("https://exchange4media.gumlet.io/news-photo/111822-big21.jpg?w=400&dpr=2.6")
            elif team2=='Rajasthan Royals':
                st.image("https://www.gupshup.io/resources/wp-content/uploads/2023/03/Group-38122.png?x61594")
            elif team2=="Royal Challengers Bangalore":
                st.image("data:image/jpeg;base64,")
            elif team2=='Delhi Capitals':
                st.image("data:image/png;base64,")
            elif team2=='Chennai Super Kings':
                st.image("data:image/png;base64,")
            elif team2=='Gujarat Titans':
                st.image("data:image/png;base64,")
            elif team2=='Lucknow Super Giants':
                st.image("data:image/jpeg;base64,")
            elif team2=='Kolkata Knight Riders':
                st.image("https://upload.wikimedia.org/wikipedia/en/thumb/4/4c/Kolkata_Knight_Riders_Logo.svg/1200px-Kolkata_Knight_Riders_Logo.svg.png")
            elif team2=='Punjab Kings':
                st.image("https://upload.wikimedia.org/wikipedia/en/thumb/d/d4/Punjab_Kings_Logo.svg/1200px-Punjab_Kings_Logo.svg.png")
            else:
                st.image("data:image/jpeg;base64,")
        else:
            st.header(team1)
            if team1=='Sunrisers Hyderabad':
                st.image("https://exchange4media.gumlet.io/news-photo/111822-big21.jpg?w=400&dpr=2.6")
            elif team1=='Rajasthan Royals':
                st.image("https://www.gupshup.io/resources/wp-content/uploads/2023/03/Group-38122.png?x61594")
            elif team1=="Royal Challengers Bangalore":
                st.image("data:image/jpeg;base64,")
            elif team1=='Delhi Capitals':
                st.image("data:image/png;base64,")
            elif team1=='Chennai Super Kings':
                st.image("data:image/png;base64,")
            elif team1=='Gujarat Titans':
                st.image("data:image/png;base64,")
            elif team1=='Lucknow Super Giants':
                st.image("data:image/jpeg;base64,")
            elif team1=='Kolkata Knight Riders':
                st.image("https://upload.wikimedia.org/wikipedia/en/thumb/4/4c/Kolkata_Knight_Riders_Logo.svg/1200px-Kolkata_Knight_Riders_Logo.svg.png")
            elif team1=='Punjab Kings':
                st.image("https://upload.wikimedia.org/wikipedia/en/thumb/d/d4/Punjab_Kings_Logo.svg/1200px-Punjab_Kings_Logo.svg.png")
            else:
                st.image("data:image/jpeg;base64,")
    except Exception as e:
        st.error(f"Prediction failed: {e}")
